import { faAngleRight, faAngleDown } from '@fortawesome/free-solid-svg-icons'

library.add(faAngleRight)
library.add(faAngleDown)

const App: React.FC = () => {
  return (
    <div className="App">
      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
